Эта страница ведется для разных целей:
- Как способ связаться и общаться с разными интересными людьми, старыми друзьями и знакомыми;
- Как копилка интересной информации по актуальным для меня вопросам;
- Как возможность поделится чем-то, что на мой взгляд интересно;
- Как возможность поделиться своими знаниями и опытом;

Друзья, товарищи - если вы делаете заявку в друзья - пишите пожалуйста о том, с какой целью вы это делаете в сообщении.

Кроме того...

В ответ на политику "ВКонтакте" я настоящим объявляю, что все мои персональные данные, иллюстрации, рисунки, статьи, комиксы, картинки, фотографии, видео и так далее являются объектами моего авторского права.

Для коммерческого использования всех вышеупомянутых объектов авторского права в каждом конкретном случае необходимо мое письменное разрешение!

   Этим коммюнике я оповещаю "ВКонтакте" о том, что разглашение, копирование, распространение моей личной информации, передача 3 лицам или любые другие противоправные действия по отношению к моему профилю в социальной сети строго запрещены.
